import React from 'react';

function ChatList({ chats, selectedChat, onSelectChat, onEditChat, onDeleteChat }) {
    return (
        <ul>
            {chats.map(chat => (
                <li key={chat.chat_name} className="chat-item">
                    <div className="chat-info" onClick={() => onSelectChat(chat.chat_name)}>
                        {`${chat.first_name} ${chat.last_name}`}
                    </div>
                    <div className="chat-actions">
                        <button onClick={() => onEditChat(chat)}>Edit</button>
                        <button onClick={() => onDeleteChat(chat.chat_name)}>Delete</button>
                    </div>
                </li>
            ))}
        </ul>
    );
}

export default ChatList;
